insert  into `catalog_product_entity_text`(`value_id`,`entity_type_id`,`attribute_id`,`store_id`,`entity_id`,`value`) values (1,4,141,0,1,''),(2,4,72,0,1,'Couch'),(3,4,62,0,1,'For a sleek, simple and stylish piece, look no further than the Magento sofa - or sofabed!'),(4,4,61,0,1,'Inspired by the classic camelback sofa, Magento offers comfort and style in a low maintenance package.  For a sleek, simple and stylish piece, look no further than the Magento sofa - or sofabed!'),(5,4,95,0,1,''),(6,4,61,0,2,'This Magento chair features a fun, futuristic design, with fluid curves and gentle angles that follow the shape of the body to enhance ultimate relaxation. It combines a hint of nostalgia with the up-to-date sensibility and function of modern chairs. It is in soft, velvety microfiber.'),(7,4,62,0,2,'Combining a hint of nostalgia with the up-to-date sensibility and function of modern chairs. It is in soft, velvety microfiber.'),(8,4,72,0,2,'Chair'),(9,4,95,0,2,''),(10,4,141,0,2,''),(11,4,141,0,3,''),(12,4,72,0,3,'Ottoman'),(13,4,62,0,3,'With durable solid wood framing, generous padding and plush stain-resistant microfiber upholstery.'),(14,4,61,0,3,'The Magento ottoman will impress with its style while it delivers on quality. This piece of living room furniture is built to last with durable solid wood framing, generous padding and plush stain-resistant microfiber upholstery.'),(15,4,95,0,3,''),(16,4,141,0,4,''),(17,4,72,0,4,'Magento, Red, Furniture, Set, ottoman, couch, chair'),(18,4,62,0,4,'Love red?  You\'ll love these pieces of handmade modern furniture!'),(19,4,61,0,4,'The perfect furniture set for the living room!  Love red?  You\'ll love these pieces of handmade modern furniture!'),(20,4,95,0,4,''),(21,4,141,0,5,'62\"W x 84\"L x 8\"H'),(22,4,72,0,5,'bamboo, barcelona, platform, bed'),(23,4,62,0,5,'Our Barcelona platform bed captures the spirit and drama of late 20th century design with a variety of subtle details.'),(24,4,61,0,5,'Entirely handcrafted of solid Bamboo. Designed for use with a mattress alone, it includes a sturdy, padded wood platform for comfort and proper mattress support.'),(25,4,95,0,5,''),(26,4,141,0,6,'21\"W x 44\"L x 35.5\"H'),(27,4,72,0,6,'Hardwood, drawers, wicker, asian, beechwood'),(28,4,62,0,6,'Our Akio dresser has a solid hardwood frame.  '),(29,4,61,0,6,'Features include inset panel sides and for spacious drawers and two wicker baskets. 41\"Wx18\"Dx36\"H.'),(30,4,95,0,6,''),(31,4,141,0,7,'16.5\"W x 78\"L x 9\"H'),(32,4,72,0,7,'Our Asian inspired bookcase fits perfectly in your home office, adding extra shelves for storing and displaying. '),(33,4,62,0,7,'Add extra shelves for storing and displaying. '),(34,4,61,0,7,'Our Asian inspired bookcase fits perfectly in your home office, adding extra shelves for storing and displaying. Crafted in Thailand of Asian beechwood. 39\'\'Wx14\'\'Dx72\'\'H.'),(35,4,95,0,7,''),(36,4,72,0,8,'HTC Touch Diamond, cell phone'),(37,4,62,0,8,'Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.'),(38,4,61,0,8,'Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.\r\n\r\nFeaturing a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use.\r\n\r\nWith HTC’s vibrant touch-responsive user interface, TouchFLO™ 3D, and ultra-fast HSDPA internet connectivity… the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection.\r\n\r\nYour contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends’ and family’s faces are brought to life for you to interact, play and launch at your fingertips.\r\n\r\nA 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit.\r\n\r\nStyle and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.'),(39,4,141,0,8,'102 mm (L) X 51 mm (W) X 11.35 mm (T)'),(40,4,145,0,8,''),(41,4,95,0,8,''),(42,4,72,0,9,'Samsung MM-A900M Ace Phone, cell, phone'),(43,4,62,0,9,'The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. '),(44,4,61,0,9,'New services supported by both the MM-A900m include the newly announced Sprint Music StoreSM, which allows users to immediately buy and download complete songs directly to their phone; 30 channels of live and on demand video and audio from Sprint TVSM and On Demand, a personalized resource guide to news, traffic, weather, sports and entertainment. The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. Features like external music-navigation keys make these phones both functional and attractive. These handsets are sure to be at the top of many wish lists.'),(45,4,141,0,9,'3.9 x 2 x 0.6 inches'),(46,4,145,0,9,'CONDITIONAL $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for activating a new, non-substitute line of service with Sprint and your agreement that for the 181-day period following such activation you will (1) pay your balance due to Sprint each month and otherwise maintain your account in good standing, (2) not disconnect this Sprint line of service, (3) not transfer this equipment to another Sprint line of service, (4) not change your Sprint service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped, and (5) not use this line of service to replace an existing account with Sprint. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this equipment discount without need for further approval.'),(47,4,95,0,9,''),(48,4,72,0,10,'AT&T 8525 PDA Phone, cell, phone'),(49,4,62,0,10,'Under the hood, the 8525 features 128MB of embedded memory and 64MB RAM, running on a 400 MHz Samsung processor. Up front, the 240 x 320 LCD touch-screen supports over 65,000 colors, while the rear of the device houses a 2.0 megapixel camera.'),(50,4,61,0,10,' The design of the 8525 is clean and uncluttered, with just a few buttons for mail, Internet Explorer, and contextual menus. Meanwhile, call answer and end buttons surround a five-way toggle that allows you to navigate and control the Windows Mobile interface. As mentioned, a full QWERTY keyboard cleverly slides out from underneath the screen. This allows you to hold the device horizontally, and the screen is automatically placed in landscape mode when you\'re using the keyboard. A side scroll wheel is conveniently tucked away on the side, making navigation when accessing the music player and other various applications a cinch when needed. A mini-SD memory expansion card slot is provided, as is an infrared port and support for a stereo Bluetooth headset. A mini-USB port is also included for wired data transfers and charging.'),(51,4,141,0,10,'4.4 x 2.4 x 0.9 inches'),(52,4,145,0,10,'Conditional $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for either activating a new, non-substitute line of service or renewing an existing line of service with AT&T and your agreement that for the 181-day period following such activation or renewal you will: (1) pay your balance due to AT&T each month and otherwise maintain your account in good standing; (2) not disconnect this AT&T line of service; (3) not transfer this equipment to another AT&T line of service; (4) not change your AT&T service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped; (5) not use this line of service to replace an existing account with AT&T. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this equipment discount without need for further approval.'),(53,4,95,0,10,''),(54,4,72,0,11,'Sony, Ericsson ,W810i, cell, phone'),(55,4,62,0,11,'The W810i follows a long tradition of beautifully designed and crafted phones from Sony Ericsson. The same candy-bar style that graced the W800 is here.'),(56,4,61,0,11,'The W810i\'s screen sports 176 x 220 pixel resolution with support for 262,000 colors. Quick access buttons below the screen make it easy to control the phone\'s Walkman music features, while a five-way center button controls most of the phone\'s menus and features.'),(57,4,141,0,11,' 3.5 x 1.8 x 1 inches'),(58,4,145,0,11,'Conditional $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for either activating a new, non-substitute line of service or renewing an existing line of service with AT&T and your agreement that for the 181-day period following such activation or renewal you will: (1) pay your balance due to AT&T each month and otherwise maintain your account in good standing; (2) not disconnect this AT&T line of service; (3) not transfer this equipment to another AT&T line of service; (4) not change your AT&T service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped; (5) not use this line of service to replace an existing account with AT&T. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this equipment discount without need for further approval.'),(59,4,95,0,11,''),(60,4,72,0,12,'Blackberry, 8100, pearl, cell, phone'),(61,4,62,0,12,'The BlackBerry 8100 Pearl is a departure from the form factor of previous BlackBerry devices. This BlackBerry handset is far more phone-like, and RIM\'s engineers have managed to fit a QWERTY keyboard onto the handset\'s slim frame.'),(62,4,61,0,12,' Like the BlackBerry 7105t, the BlackBerry 8100 Pearl is \r\nThe BlackBerry 8100 Pearl sports a large 240 x 260 screen that supports over 65,000 colors-- plenty of real estate to view your e-mails, Web browser content, messaging sessions, and attachments. The venerable BlackBerry trackwheel has been replaced on this model with an innovative four-way trackball placed below the screen. On the rear of the handheld, you\'ll find a 1.3-megapixel camera and a self portrait mirror. The handheld\'s microSD memory card slot is located inside the device, behind the battery. There\'s also a standard 2.5mm headset jack that can be used with the included headset, as well as a mini-USB port for data connectivity.'),(63,4,141,0,12,'4.2 x 2 x 0.6 inches '),(64,4,145,0,12,'CONDITIONAL $250 Equipment Discount Included: Your price paid includes an Equipment Discount of $250 that has been provided to you in exchange for activating a new, non-substitute line of service with T-Mobile and your agreement that for the 181-day period following such activation you will (1) pay your balance due to T-Mobile each month and otherwise maintain your account in good standing, (2) not disconnect this T-Mobile line of service, (3) not transfer this equipment to another T-Mobile line of service, (4) not change your T-Mobile service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped, (5) not use this line of service to replace an existing account with T-Mobile. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this Equipment Discount without need for further approval.'),(65,4,95,0,12,''),(66,4,72,0,13,'Nokia 2610, cell, phone, '),(67,4,62,0,13,'The words \"entry level\" no longer mean \"low-end,\" especially when it comes to the Nokia 2610. Offering advanced media and calling features without breaking the bank'),(68,4,61,0,13,'The Nokia 2610 is an easy to use device that combines multiple messaging options including email, instant messaging, and more. You can even download MP3 ringtones, graphics, and games straight to the phone, or surf the Internet with Cingular\'s MEdia Net service. It\'s the perfect complement to Cingular service for those even remotely interested in mobile Web capabilities in an affordable handset.<br><br>\r\n\r\n<b>Design</b><br>\r\nCompact and stylish, the 2610 features a candybar design sporting a bright 128 x 128 pixel display capable of displaying over 65,000 colors. Most of the phone\'s features and on-screen menus are controlled by a center toggle on the control pad. A standard hands-free headphone jack is provided, as are volume control keys, and there\'s even a \"Go-To\" button that can be assigned by the user for quick access to favorite applications. Lastly, the included speakerphone allows you to talk handsfree, and because the phone sports an internal antenna, there\'s nothing to snag or break off.\r\n'),(69,4,141,0,13,'4.1 x 1.7 x 0.7 inches '),(70,4,145,0,13,'Conditional $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for either activating a new, non-substitute line of service or renewing an existing line of service with AT&T and your agreement that