insert  into `cms_page`(`page_id`,`title`,`root_template`,`meta_keywords`,`meta_description`,`identifier`,`content_heading`,`content`,`creation_time`,`update_time`,`is_active`,`sort_order`,`layout_update_xml`,`custom_theme`,`custom_root_template`,`custom_layout_update_xml`,`custom_theme_from`,`custom_theme_to`,`published_revision_id`,`website_root`,`under_version_control`) values (1,'404 Not Found 1','two_columns_right','Page keywords','Page description','no-route','','<div class=\"page-head-alt\"><h3>We are sorry, but the page you are looking for cannot be found.</h3></div>\n<div>\n    <ul class=\"disc\">\n        <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n        <li>If you clicked on a link to get here, we must have moved the content.<br/>Please try our store search box above to search for an item.</li>\n        <li>If you are not sure how you got here, <a href=\"#\" onclick=\"history.go(-1);\">go back</a> to the previous page</a> or return to our <a href=\"{{store url=\"\"}}\">store homepage</a>.</li>\n    </ul>\n</div>\n\n<!-- <div class=\"page-title\"><h1>Whoops, our bad...</h1></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Accoun