  `iso2_code` varchar(2) NOT NULL COMMENT 'Country ISO-2 format',
  `iso3_code` varchar(3) NOT NULL COMMENT 'Country ISO-3',
  PRIMARY KEY  (`country_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Directory Country';

