insert  into `enterprise_cms_page_revision`(`revision_id`,`version_id`,`page_id`,`root_template`,`meta_keywords`,`meta_description`,`content_heading`,`content`,`created_at`,`layout_update_xml`,`custom_theme`,`custom_root_template`,`custom_layout_update_xml`,`custom_theme_from`,`custom_theme_to`,`user_id`,`revision_number`) values (1,1,1,'two_columns_right','Page keywords','Page description','','<div class=\"page-title\"><h1>Whoops, our bad...</h1></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2010-09-22 00:00:00',NULL,NULL,'',NULL,NULL,NULL,NULL,1),(2,2,2,'two_columns_right','','','','<div class=\"page-title\"><h2>Home Page</h2></div>\r\n','2010-09-22 00:00:00','<!--<reference name=\"content\">\n<block type=\"catalog/product_new\" name=\"home.catalog.product.new\" alias=\"product_new\" template=\"catalog/product/new.phtml\" after=\"cms_page\"><action method=\"addPriceBlockType\"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\n<block type=\"reports/product_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_pro