/*Table structure for table `enterprise_reminder_rule` */

DROP TABLE IF EXISTS `enterprise_reminder_rule`;

CREATE TABLE `enterprise_reminder_rule` (
  `rule_id` int(10) unsigned NOT NULL auto_increment COMMENT 'Rule Id',
  `name` varchar(255) default NULL COMMENT 'Name',
  `description` text COMMENT 'Description',
  `conditions_serialized` mediumtext NOT NULL COMMENT 'Conditions Serialized',
  `condition_sql` mediumtext COMMENT 'Condition Sql',
  `is_active` smallint(5) unsigned NOT NULL default '0' COMMENT 'Is Active',
  `salesrule_id` int(10) unsigned default NULL COMMENT 'Salesrule Id',
  `schedule` varchar(255) default NULL COMMENT 'Schedule',
  `default_label` varchar(255) default NULL COMMENT 'Default Label',
  `default_description` text COMMENT 'Default Description',
  `from_date` date default NULL,
  `to_date` date default NULL,
  PRIMARY KEY  (`rule_id`),
  KEY `IDX_ENTERPRISE_REMINDER_RULE_SALESRULE_ID` (`salesrule_id`),
  CONSTRAINT `FK_ENTERPRISE_REMINDER_RULE_SALESRULE_ID_SALESRULE_RULE_ID` FOREIGN KEY (`salesrule_id`) REFERENCES `salesrule` (`rule_id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='Enterprise Reminder Rule';

/*Data for the table `enterprise_reminder_rule` */

LOCK TABLES `enterprise_reminder_rule` WRITE;

insert  into `enterprise_reminder_rule`(`rule_id`,`name`,`description`,`conditions_serialized`,`condition_sql`,`is_active`,`salesrule_id`,`schedule`,`default_label`,`default_description`,`from_date`,`to_date`) values (1,'Guest Wishlist with 10% Off','','a:7:{s:4:\"type\";s:47:\"enterprise_reminder/rule_condition_combine_root\";s:9:\"attribute\";N;s:8:\"operator\";N;s:5:\"value\";s:1:\"1\";s:18:\"is_value_processed\";N;s:10:\"aggregator\";s:3:\"all\";s:10:\"conditions\";a:1:{i:0;a:6:{s:4:\"type\";s:43:\"enterprise_reminder/rule_condition_wishlist\";s:9:\"attribute\";N;s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:1:\"3\";s:18:\"is_value_processed\";N;s:10:\"aggregator\";s:3:\"all\";}}}','SELECT `root`.`entity_id`, `c`.`coupon_id` FROM `customer_entity` AS `root`\n LEFT JOIN `enterprise_reminder_rule_coupon` AS `c` ON c.customer_id=root.entity_id AND c.rule_id=:rule_id WHERE (website_id=:website_id) AND ((IFNULL((SELECT 1 FROM `wishlist_item` AS `item`\n INNER JOIN `wishlist` AS `list` ON item.wishlist_id = list.wishlist_id\n INNER JOIN `core_store` AS `store` ON item.store_id=store.store_id WHERE (store.website_id=:website_id) AND (UNIX_TIMESTAMP(\'2010-09-24 16:50:05\' - INTERVAL 3 DAY) = UNIX_TIMESTAMP(list.updated_at)) AND (list.customer_id = root.entity_id) LIMIT 1), 0) = 1))',1,2,'','','',NULL,NULL);

UNLOCK TABLES;

/*Table structure for table `enterprise_reminder_rule_coupon` */

DROP TABLE IF EXISTS `enterprise_reminder_rule_coupon`;

CREATE TABLE `enterprise_reminder_rule_coupon` (
  `rule_id` int(10) unsigned NOT NULL COMMENT 'Rule Id',
  `coupon_id` int(10) unsigned default NULL COMMENT 'Coupon Id',
  `customer_id` int(10) unsigned NOT NULL COMMENT 'Customer Id',
  `associated_at` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP COMMENT 'Associated At',
  `emails_failed` smallint(5) unsigned NOT NULL default '0' COMMENT 'Emails Failed',
  `is_active` smallint(5) unsigned NOT NULL default '1' COMMENT 'Is Active',
